import React from "react";
import "./App.css";
import { BrowserRouter, Router } from "react-router-dom"; // Import routing components

import Signin from "./component/signin/signin";
import Otp from "./component/otp/otp";
import Success from "./component/success/success";

const App = () => {
  return (
    <BrowserRouter>
      <div className="App">
        <Router path="/" exact component={Signin} />
        <Router path="/otp" component={Otp} />
        <Router path="/success" component={Success} />
      </div>
    </BrowserRouter>
  );
};

export default App;
